public boolean isCanceled()
{
    return (select firstonly RecId from CustRORReturnNoteTrans
            where CustRORReturnNoteTrans.SalesId        == this.SalesId
            &&    CustRORReturnNoteTrans.ReturnNoteId   == this.ReturnNoteId
            &&    CustRORReturnNoteTrans.DeliveryDate   == this.DeliveryDate
            &&    CustRORReturnNoteTrans.Qty            != 0).RecId == 0;
}

public boolean isDropShipment()
{
    return (select firstOnly RecId from CustRORReturnNoteTrans
            where CustRORReturnNoteTrans.ReturnNoteId   == this.ReturnNoteId
            &&    CustRORReturnNoteTrans.SalesId        == this.SalesId
            &&    CustRORReturnNoteTrans.DeliveryDate   == this.DeliveryDate
            &&    CustRORReturnNoteTrans.DeliveryType   == TradeLineDlvType::DropShip).RecId != 0;
}

