public boolean isSummaryUpdated()
{
    Query       query = this.queryCustReturnNoteSalesLink();
    QueryRun    queryRun;

    query.dataSourceTable(tableNum(CustRORReturnNoteSalesLink)).firstOnly(true);
    query.dataSourceTable(tableNum(CustRORReturnNoteSalesLink)).addRange(fieldNum(CustRORReturnNoteSalesLink, OrigSalesId)).value(SysQuery::valueNot(this.SalesId));

    queryRun = new QueryRun(query);

    return queryRun.next();
}

