SalesTable  salesTable(boolean _update = false)
{
    SalesTable  salesTable = SalesTable::find(this.SalesId, _update);

    if (!salesTable && this.SalesId
    &&  SalesTableDelete::find(this.SalesId).SalesTable)
    {
        [salesTable] = SalesTableDelete::find(this.SalesId).SalesTable;
    }

    return salesTable;
}

public void sendElectronically(PrintCopyOriginal _printCopyOriginal, boolean _showWarning = true)
{
    if (this.canXMLBeSent())
    {
        Args args = new Args();
        args.parmEnumType(enumnum(PrintCopyOriginal));
        args.parmEnum(_printCopyOriginal);
        args.record(this);

        new MenuFunction(menuitemOutputStr(EInvoiceGeneration), MenuItemType::Output).run(args);

        info("@SYS344889");
    }
    else
    {
        if (_showWarning)
        {
            warning (strFmt("@SYS100814", this.InvoiceAccount));
        }
    }
}

void setInvoiceAddress(SalesTable _salesTable)
{
    CustInvoiceJour custInvoiceJour;
    LogisticsPostalAddress deliveryAddress;

    custInvoiceJour.OrderAccount = _salesTable.CustAccount;
    custInvoiceJour.InvoiceAccount = _salesTable.InvoiceAccount;
    if (_salesTable.ProjId)
    {
        custInvoiceJour.setInvoiceAddressFromProject(_salesTable.ProjId);
    }
    else
    {
        custInvoiceJour.setInvoiceAddress(_salesTable);
    }

    if (!custInvoiceJour.InvoicePostalAddress)
    {
        if (_salesTable.DeliveryPostalAddress)
        {
            deliveryAddress = _salesTable.deliveryAddress();
            this.InvoicingName           = LogisticsLocation::find(deliveryAddress.Location).Description;
            this.InvoicePostalAddress    = _salesTable.DeliveryPostalAddress;
        }
        else
        {
            this.InvoicingName           =  this.DeliveryName;
            this.InvoicePostalAddress    =  this.DeliveryPostalAddress;
        }
    }
    else
    {
            this.InvoicingName           =  custInvoiceJour.InvoicingName;
            this.InvoicePostalAddress    =  custInvoiceJour.InvoicePostalAddress;
    }
}

public static client boolean exist(SalesId _salesId)
{
    return _salesId && (select firstOnly RecId from CustRORReturnNoteJour
                        where CustRORReturnNoteJour.SalesId == _salesId).RecId;
}

public static CustRORReturnNoteJour findFromCustReturnNoteTrans(SalesId                 _salesId,
                                                                RORReturnNoteId_Rental  _returnNoteId,
                                                                TransDate               _packingslipDate,
                                                                boolean                 _update = false)
{
    CustRORReturnNoteJour returnNoteJour;

    if (_returnNoteId)
    {
        returnNoteJour.selectForUpdate(_update);

        select firstonly returnNoteJour
        where returnNoteJour.SalesId       == _salesId
        &&    returnNoteJour.ReturnNoteId  == _returnNoteId
        &&    returnNoteJour.DeliveryDate  == _packingslipDate;
    }

    return returnNoteJour;
}

public static client server CustRORReturnNoteJour findRecId(RecId   _recId,
                                                            boolean _forUpdate = false)
{
    CustRORReturnNoteJour returnNoteJour;

    returnNoteJour.selectForUpdate(_forUpdate);

    select firstonly returnNoteJour
    where returnNoteJour.RecId == _recId;

    return returnNoteJour;
}
